import React from 'react'
import styled from "styled-components";

const Container = styled.div`
    background-color:var(--p-5);
    height:300px;
    width:300px;
    position:relative;
    font-size:100px;
`

const Box1 = styled.div`
    background-color:var(--s-5);
    height:1em;
    width:1em;
    position:absolute;
    opacity:50%;
`

const Box3 = styled.div`
    background-color:var(--s-3);
    height:1em;
    width:1em;
    position:absolute;
    transform:translateY(-.92em) skew(30deg) rotateX(30deg);
    opacity:50%;
`
const Row = styled.div`
    top:50%;
    left:50%;
    position:absolute;
`

export default function Figure() {
    return (
        <Container>
            <Row>
                <Box1/>
                <Box3/>
            </Row>
        </Container>
    )
}
